Male genitalia:
Pygofer less than twice as long as wide, moderately projected posteriorly, apex oblong, sides rounded to broad point; macrosetae long, distributed along apical third of pygofer (
Fig. 53a
). Valve margins rounded, slightly curved anterior medially. Plate long, apex pointed, setae short (
Fig. 53b
). Style with short apophysis, rugose, straight, apex truncate (
Fig. 53c
). Aedeagus in ventral view, with narrow base, curved, with lateral margins curved and wide; shaft straight, slender, apex truncate, shorter than ventral processes (
Fig. 53d
). Ventral processes arising at one-third length of aedeagus, divergent, rugose for most of length, apices pointed. In lateral view shaft slender, apex truncate, curved dorsad then caudad near apex, shorter than ventral processes; dorsal projection wide and truncate. Gonopore apical. Ventral processes very separate from shaft, tapered, slender, with sclerotized spirals, apices pointed (
Fig. 53e
).
